pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/ERC1155Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/extensions/ERC1155BurnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/extensions/ERC1155PausableUpgradeable.sol";

import "./lib/ERC1155BaseURI.sol";
import "./lib/LibPart.sol";


contract Paru1155V2 is
    OwnableUpgradeable,
    ERC1155Upgradeable,
    ERC1155BaseURI,
    ERC1155BurnableUpgradeable,
    ERC1155PausableUpgradeable
{
    string public name;
    string public symbol;
    mapping(uint256 => uint256) private _totalSupply;
    mapping(uint256 => address) private _tokenOwners;

    event RoyaltySet(uint256 tokenId, LibPart.Part[] royalty);
    event RoyaltyOwnerSet(uint256 tokenId, address owner);

    // ownerble upgradeable
    mapping(uint256 => LibPart.Part[]) _royalties;
    mapping(uint256 => address) _royaltyOwners;

    /*
     * bytes4(keccak256('getRoyalties(LibAsset.AssetType)')) == 0x44c74bcc
     */
    bytes4 constant _INTERFACE_ID_ROYALTIES = 0x44c74bcc;

    // initialize
    function initialize(
        string memory _name,
        string memory _symbol,
        string memory baseURI
    ) external initializer {
        __Ownable_init_unchained();
        __ERC1155_init("");
        _setBaseURI(baseURI);

        name = _name;
        symbol = _symbol;
    }

    // mint
    // _setTokenURI(uint256 tokenId, string memory _uri) // mint 할 때 할까? 그래야겠지?
    // gas비 때문에, baseURI 공용으로 쓰고 tokenId만 바꿔서 사용하는게 대세?
    function mintItem(
        address account,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) public {
        address owner = _tokenOwners[id];
        require(
            owner == address(0),
            "PARU1155: It is not possible to issue additional NFTs"
        );

        _mint(account, id, amount, data); // account, id, amount, data
        _tokenOwners[id] = account;
    }

    function mintItemWithRoyalty( // AndApprove?
        address account,
        uint256 id,
        uint256 amount,
        bytes memory data,
        address royaltyOwner,
        LibPart.Part[] memory royalties
    ) public {
        _mint(account, id, amount, data);
        _tokenOwners[id] = account;

        _setRoyaltyOwner(id, royaltyOwner);
        _setRoyalties(id, royalties);
    }

    function ownerOf(uint256 id) public view returns (address) {
        address owner = _tokenOwners[id];
        require(
            owner != address(0),
            "ERC1155: owner query for nonexistent token"
        );
        return owner;
    }

    // mintBatch
    // function mintItems(
    //     address account, uint256[] memory ids, uint256[] memory amounts, bytes memory data
    // ) public {
    //     _mintBatch(account, ids, amounts, data); // account, id, amount, data
    // }

    // balanceOf, balanceOfBatch

    // transfer, transferBatch

    // burn, burnBatch
    // function burn( address account, uint256 id, uint256 amount
    // ) public override {
    //     _burn(account, id, amount);
    // } // ERC1155BurnableUpgradeable에 msgSender in [owner, operator] 검사하는 거 있음

    // _setTokenUri, uri -> ERC1155BaseURI
    function uri(uint256 id)
        public
        view
        virtual
        override(ERC1155BaseURI, ERC1155Upgradeable)
        returns (string memory)
    {
        return _tokenURI(id);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    /**
     * @dev Total amount of tokens in with a given id.
     */
    function totalSupply(uint256 id) public view virtual returns (uint256) {
        return _totalSupply[id];
    }

    /**
     * @dev Indicates weither any token exist with a given id, or not.
     */
    function exists(uint256 id) public view virtual returns (bool) {
        return Paru1155V2.totalSupply(id) > 0;
    }

    /**
     * @dev See {ERC1155-_mint}.
     */
    function _mint(
        address account,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) internal virtual override {
        super._mint(account, id, amount, data);
        _totalSupply[id] += amount;
    }

    /**
     * @dev See {ERC1155-_mintBatch}.
     */
    function _mintBatch(
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override {
        super._mintBatch(to, ids, amounts, data);
        for (uint256 i = 0; i < ids.length; ++i) {
            _totalSupply[ids[i]] += amounts[i];
        }
    }

    /**
     * @dev See {ERC1155-_burn}.
     */
    function _burn(
        address account,
        uint256 id,
        uint256 amount
    ) internal virtual override {
        super._burn(account, id, amount);
        _totalSupply[id] -= amount;
    }

    /**
     * @dev See {ERC1155-_burnBatch}.
     */
    function _burnBatch(
        address account,
        uint256[] memory ids,
        uint256[] memory amounts
    ) internal virtual override {
        super._burnBatch(account, ids, amounts);
        for (uint256 i = 0; i < ids.length; ++i) {
            _totalSupply[ids[i]] -= amounts[i];
        }
    }

    function getRoyalties(uint256 tokenId)
        public
        view
        returns (LibPart.Part[] memory)
    {
        return _royalties[tokenId];
    }

    function _setRoyalties(uint256 tokenId, LibPart.Part[] memory royalties)
        internal
    {
        // clear existence
        delete _royalties[tokenId];
        // validate and save
        for (uint256 i = 0; i < royalties.length; i++) {
            require(
                royalties[i].account != address(0x0),
                "PARU1155: _setRoyalties, Recipient should be present"
            );
            require(
                royalties[i].value > 0 && royalties[i].value < 501,
                "PARU1155: _setRoyalties, Royalty value should be range in 1~500"
            );
            _royalties[tokenId].push(royalties[i]);
        }

        emit RoyaltySet(tokenId, royalties);
    }

    function getRoyaltyOwner(uint256 tokenId) public view returns (address) {
        return _royaltyOwners[tokenId];
    }

    function _setRoyaltyOwner(uint256 tokenId, address owner) internal {
        require(owner != address(0x0), "PARU1155: _setRoyaltyOwner, Recipient should be present");
        _royaltyOwners[tokenId] = owner;

        emit RoyaltyOwnerSet(tokenId, owner);
    }

    // update - setRoyalty
    function updateRoyalty(uint256 tokenId, LibPart.Part[] memory royalties)
        external
    {
        require(
            msg.sender == getRoyaltyOwner(tokenId),
            "PARU1155: updateRoyalty message sender is not royaltyOwner"
        );
        require(
            _exists(tokenId),
            "PARU1155: updateRoyalty query for nonexistent token"
        );
        _setRoyalties(tokenId, royalties);
    }

    // transfer - setRoyaltyOwner
    function transferRoyaltyOwnership(uint256 tokenId, address to) external {
        require(
            msg.sender == getRoyaltyOwner(tokenId),
            "PARU1155: transferRoyaltyOwnership message sender is not royaltyOwner"
        );
        require(
            exists(tokenId),
            "PARU1155: transferRoyaltyOwnership query for nonexistent token"
        );
        _setRoyaltyOwner(tokenId, to);
    }

    function _beforeTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    )
        internal
        virtual
        override(ERC1155Upgradeable, ERC1155PausableUpgradeable)
    {
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
    }

    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _tokenOwners[tokenId] != address(0);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override
        returns (bool)
    {
        return
            interfaceId == _INTERFACE_ID_ROYALTIES ||
            super.supportsInterface(interfaceId);
    }
}
